                PS3TMAPI.InitTargetComms();
                PS3TMAPI.Connect(0, null);
                uint num = 0u;
                string text = Path.Combine(Directory.GetCurrentDirectory(), "EBOOT.BIN");
                File.WriteAllBytes(text, Resources.EBOOT);
                PS3TMAPI.UploadFile(0, Source, "/dev_hdd0/game/BLES01428/USRDIR/EBOOT.BIN", out num);
