        public static float[] AnglesToForward3(float[] Angles, float Distance = 200f)
        {
            float num = 0.0174532924f;
            float num2 = Angles[1] * num;
            float num3 = (float)Math.Sin((double)num2);
            float num4 = (float)Math.Cos((double)num2);
            num2 = Angles[0] * num;
            float num5 = (float)Math.Sin((double)num2);
            float num6 = (float)Math.Cos((double)num2);
            num2 = Angles[2] * num;
            float num7 = (float)Math.Sin((double)num2);
            float num8 = (float)Math.Cos((double)num2);
            return new float[]
            {
                num6 * num4 * Distance,
                num6 * num3 * Distance,
                -num5 * Distance
            };
        }


