        private static void ChopperFunction(uint Client, uint Height = 400u, uint THeight = 400u, string vehicle1 = "littlebird_mp", string vehicle2 = "vehicle_little_bird_armed", uint VehicleFX = 1u)
        {
            PS3.ConnectTarget();
            uint num = Form1.Set_Pet_Vehicle2(Client, Height, vehicle1, vehicle2);
            uint num2 = Form1.LittleBird_Turret_Right(Client, THeight, true);
            uint num3 = Form1.Littlebird_Turret_Left(Client, THeight, true);
            Form1.AllVehicles_FX(num, VehicleFX);
            Form1.G_EntLinkTo(num2, num);
            Form1.G_EntLinkTo(num3, num);
            Form1.G_EntLinkTo(Form1.G_Entity((int)Client, 0u), num);
            Form1.CameraLinkTo(Client, num, "tag_origin");
            Form1.ControlsLinkTo(Client, num);
            Form1.StoreText2(701u, Client, "[{+speed_throw}] Fire 2.75-inch Rockets || [{+attack}] Fire 7.62 Miniguns || [{+smoke}] Fly Down || [{+frag}] Fly Up || [{weapnext}] Drop Bombs || [{+stance}] Flare || [{+activate}] ^1Exit", 7, 0.7f, -60, 410, 255m, 255m, 255m, 255m, 0m, 0m, 0m, 0m);
            while (Form1.FCThread.IsAlive)
            {
                if (Form1.ClientButtonIsDown(Client, Form1.ClientsButton.BUTTON_R1, false))
                {
                    Form1.Turret_Shoot(num2);
                    Form1.Turret_Shoot(num3);
                }
                if (Form1.ClientButtonIsDown(Client, Form1.ClientsButton.BUTTON_L1, false))
                {
                    Form1.Countername889++;
                    switch (Form1.Countername889)
                    {
                        case 1:
                            Form1.RocketChopper_Left(Client, "ac130_105mm_mp");
                            Thread.Sleep(200);
                            break;
                        case 2:
                            Form1.RocketChopper_Right(Client, "ac130_105mm_mp");
                            Thread.Sleep(200);
                            break;
                    }
                    if (Form1.Countername889 == 3)
                    {
                        Form1.Countername889 = 0;
                    }
                }
