        public static void Disco()
        {
            PS3.ConnectTarget();
            while (Form1.DiscoThread.IsAlive)
            {
                for (double num = 1.0; num < 14.0; num += 1.0)
                {
                    if (num > 2.0)
                    {
                        if (num > 4.0)
                        {
                            if (num > 6.0)
                            {
                                if (num > 8.0)
                                {
                                    if (num > 10.0)
                                    {
                                        if (num == 13.0)
                                        {
                                            RPC.iPrintln(-1, "^5Partytime ^1<3");
                                        }
                                        else
                                        {
                                            Form1.SetSunLight(-1, num - 10.0, 0.0, num - 10.0);
                                        }
                                    }
                                    else
                                    {
                                        Form1.SetSunLight(-1, 0.0, 0.0, num - 8.0);
                                    }
                                }
                                else
                                {
                                    Form1.SetSunLight(-1, 0.0, num - 6.0, num - 6.0);
                                }
                            }
                            else
                            {
                                Form1.SetSunLight(-1, 0.0, num - 4.0, 0.0);
                            }
                        }
                        else
                        {
                            Form1.SetSunLight(-1, num - 2.0, num - 2.0, 0.0);
                        }
                    }
                    else
                    {
                        Form1.SetSunLight(-1, num, 0.0, 0.0);
                    }
                    Thread.Sleep(200);
                }

            }
        }


        private void metroButton160_Click(object sender, EventArgs e)
        {
            if (this.metroButton160.Text == "Sun Loop OFF")
            {
                ThreadStart threadStart = null;
                Thread.Sleep(100);
                if (threadStart == null)
                {
                    threadStart = delegate
                    {
                        Form1.Disco();
                    };
                }
                Form1.DiscoThread = new Thread(threadStart);
                Form1.DiscoThread.IsBackground = true;
                Form1.DiscoThread.Start();
                this.metroButton160.Text = "Sun Loop ON";
            }
            else if (this.metroButton160.Text == "Sun Loop ON")
            {
                Form1.DiscoThread.Abort();
                Form1.SetSunLight(-1, 1.0, 1.0, 1.0);
                this.metroButton160.Text = "Sun Loop OFF";
            }
        }

