        public static void GodMode(uint Client, bool IsTrue = true)
        {
            if (IsTrue)
            {
                PS3.SetMemory(17755176u + Client * 628u, new byte[]
                {
                        100,
                        byte.MaxValue,
                        byte.MaxValue,
                        byte.MaxValue,
                        byte.MaxValue
                });
                PS3.SetMemory(17755176u + Client * 45256u, new byte[]
                {
                        0,
                        21
                });
            }
            else
            {
                uint address = 17755176u + Client * 628u;
                byte[] array = new byte[5];
                array[3] = 100;
                PS3.SetMemory(address, array);
                uint address2 = 17755176u + Client * 45256u;
                array = new byte[2];
                PS3.SetMemory(address2, array);
            }
        }

