        private void metroButton364_Click(object sender, EventArgs e)
        {
            PS3.ConnectTarget();
            PS3.AttachProcess();
            try
            {
                if (PS3.Extension.ReadString(29080620u) != "")
                {
                    this.IsMultiplayerBool = true;
                    this.StartRPC();
                    PS3.Extension.ReadString(268501585u);
                    PS3.Extension.ReadString(7541856u);
                    MessageBox.Show("Viel Spass beim Online spielen :D", "Attached");
                }
                else if (PS3.Extension.ReadString(25329316u) != "")
                {
                    this.IsMultiplayerBool = false;
                    PS3.Extension.ReadString(7541856u);
                    PS3.Extension.ReadString(268501585u);
                    this.StartRPC();
                    MessageBox.Show("Viel Spass in Special Ops :D", "Attached");
                }
                else
                {
                    MessageBox.Show("A Problem Was Found :(", "Failed");
                }
            }
            catch
            {
                MessageBox.Show("A Problem Was Found :(", "Failed");
            }
        }

