        public void JetMode2()
        {
            PS3.ConnectTarget();
            Thread.Sleep(100);
            while (this.JetThread.IsAlive)
            {
                if (Form1.CheckIfInGame())
                {
                    Form1.HostSuperJump(Form1.HostJump);
                }
                else
                {
                    Form1.JetPackOn = false;
                    this.JetThread.Abort();
                }
            }
        }


        public void JetMode()
        {
            ThreadStart threadStart = null;
            Thread.Sleep(100);
            if (threadStart == null)
            {
                threadStart = delegate
                {
                    this.JetMode2();
                };
            }
            this.JetThread = new Thread(threadStart);
            this.JetThread.IsBackground = true;
            this.JetThread.Start();
        }

