        public void SAveXuidToList(int Client)
        {
            if (Form1.CheckIfClientInGame((uint)Client))
            {
                string text = Form1.GetName(Client);
                if (text != "")
                {
                    if (!text.Contains("(1)"))
                    {
                        int num = this.listBox4.FindString(text, -1);
                        if (num == -1)
                        {
                            string xuid = Form1.GetXUID((uint)Client);
                            int num2 = this.listBox4.FindString(xuid, -1);
                            if (num2 == -1)
                            {
                                if (xuid != "" && xuid.Length == 16)
                                {
                                    string land = Form1.GetLand((uint)Client);
                                    if (land != "" && land.Length == 7)
                                    {
                                        this.listBox4.Items.Add(string.Concat(new string[]
                                        {
                                            text,
                                            "/",
                                            xuid,
                                            "/",
                                            land
                                        }));
                                        this.listBox4.Refresh();
                                    }
                                }
                            }
                        }
                    }
                }
            }
            Form1.SaveXUIDs(this.listBox4);
        }

