        public static string ReadHostName()
        {
            string StringRead;
            if (IsInParty)
                StringRead = PS3.Extension.ReadString(PartyName + (HostIndex * GrabInterval));
            else
                StringRead = PS3.Extension.ReadString(LobbyName + (HostIndex * GrabInterval));
            if (HostIndex < 18)
            {
                switch (StringRead)
                {
                    case null: return "Unknown";
                    case "": return "Unknown";
                    default: return StringRead;
                }
            }
            else
                return $"{ReadDediedServerIP(PS3.Extension.ReadBytes(HostIP, 4))}:{ReadPort(PS3.Extension.ReadBytes(HostPort, 2))}";
        }

        public static string ReadPort(byte[] input)
        {
            string Port = (input[1] << 8 | input[0]).ToString();
            switch (Port)
            {
                case "0": return "Unknown";
                default: return Port;
            }
        }

        public static string ReadDediedServerIP(byte[] mem)
        {
            string IP = $"{mem[0]}.{mem[1]}.{mem[2]}.{mem[3]}";
            return IP;
        }

        public static string ReadModdedGame()
        {
            if (IsInGame)
            {
                if (Dvar_GetInt("pdc") == 0)
                {
                    if (Dvar_GetString("motd").Contains("kurt"))
                    {
                        return "Modded (Menace)";
                    }
                    else if (Dvar_GetString("motd").Contains("kiwi_modz"))
                    {
                        return "Modded (ßläçk·Gëñísýs)";
                    }
                    else if (Dvar_GetString("motd").Contains("^5All Client Recovery Reactor"))
                    {
                        return "Modded (All Client Recovery Reactor)";
                    }
                    else
                    {
                        return "Modded";
                    }
                }
                else
                {
                    return "Normal";
                }
            }
            else
            {
                return "Unknown";
            }
        }

        public static string GetGameMode()
        {
            if (IsInGame)
            {
                switch (GetServerInfo(2))
                {
                    case "war":
                        return "Team Deathmatch";
                    case "tdm":
                        return "Team Deathmatch";
                    case "dm":
                        return "Free-for-All";
                    case "ffa":
                        return "Free-for-All";
                    case "sd":
                        return "Search and Destroy";
                    case "dom":
                        return "Domination";
                    case "conf":
                        return "Kill Confirmed";
                    case "sab":
                        return "Sabotage";
                    case "koth":
                        return "Headquarters Pro";
                    case "hq":
                        return "Headquarters Pro";
                    case "ctf":
                        return "Capture the Flag";
                    case "infect":
                        return "Infected";
                    case "sotf":
                        return "Hunted";
                    case "dd":
                        return "Demolition";
                    case "dem":
                        return "Demolition";
                    case "grnd":
                        return "Drop Zone";
                    case "tdef":
                        return "Team Defender";
                    case "oneflag":
                        return "One Flag CTF";
                    case "tjugg":
                        return "Team Juggernaut";
                    case "jugg":
