        public static string GetServerInfo(int Index)
        {
            try
            {
                byte[] buffer = new byte[0x100];
                PS3.GetMemory(0x8360D5, buffer);
                return Form1.ByteArrayToString(buffer).Split('\\')[Index];
            }
            catch
            {
                return "Unknown";
            }
        }

        private void CheckBW_DoWork(object sender, DoWorkEventArgs e)
        {
            PS3.ConnectTarget();
            Thread.Sleep(100);
            for (; ; )
            {
                if (CheckConnection())
                {
                    if (CurrentGame == "unknown")
                        GetGame();
                    IsInGame = InGame();
                    IsHostVerified = ImHost();
                    CurrentGameMode = GetGameMode();
                    UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, 18].Value = $"Host : {ReadHostName()}"));
                    UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, 19].Value = ReadModdedGame()));
                    if (IsInGame && IsHostVerified)
                    {
                        CreatorDetect = ISNotCreator();
                        IsSelectedConnectedPlayer = OnPlayerConnected((uint)SelectedPlayerIndex);
                        IsNotBot = !isBot(SelectedPlayerIndex);
                        for (int i = 0; i < 18; i++)
                        {
                            UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, i].Value = GetNameInGame(i)));
                        }
                        if (!IsStatsActived)
                        {
                            ValidStats();
                            IsStatsActived = true;
                        }
                        if (!HostNotify)
                        {
                            if (OnPlayerSpawned(HostIndex))
                            {
                                iPrintln($"Welcome ^5{PS3.Extension.ReadString(LocalName)} ^7to ^1RATModzV6\n^7by ^2RATModz");
                                HostNotify = true;
                            }
                        }
                        if (!IsSelectedConnectedPlayer);
                    }
                    else
                    {
                        for (int i = 0; i < 18; i++)
                        {
                            UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, i].Value = ""));
                        }
                        if (HostNotify)
                            HostNotify = false;
                        if (IsStatsActived)
                            IsStatsActived = false;
                    }
                }
                else
                {
                    for (int i = 0; i < 18; i++)
                    {
                        UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, i].Value = ""));
                    }
                    UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, 18].Value = "Host : Unknown"));
                    UserGridView.Invoke((MethodInvoker)(() => UserGridView[0, 19].Value = "Unknown"));
                    if (HostNotify)
                        HostNotify = false;
                    if (IsStatsActived)
                        IsStatsActived = false;
                    IsInGame = false;
                    IsHostVerified = false;
                }
                Thread.Sleep(500);
            }
        }

