        private int ColorClass(Control ctrl)
        {
            if (ctrl == CustomClassTxt1 || ctrl == CustomClassTxt6 || ctrl == CustomClassTxt11 || ctrl == PrivateClassTxt1)
                return 1;
            else if (ctrl == CustomClassTxt2 || ctrl == CustomClassTxt7 || ctrl == CustomClassTxt12 || ctrl == PrivateClassTxt2)
                return 2;
            else if (ctrl == CustomClassTxt3 || ctrl == CustomClassTxt8 || ctrl == CustomClassTxt13 || ctrl == PrivateClassTxt3)
                return 3;
            else if (ctrl == CustomClassTxt4 || ctrl == CustomClassTxt9 || ctrl == CustomClassTxt14 || ctrl == PrivateClassTxt4)
                return 5;
            else if (ctrl == CustomClassTxt5 || ctrl == CustomClassTxt10 || ctrl == CustomClassTxt15 || ctrl == PrivateClassTxt5)
                return 6;
            return 7;
        }

